using MVZ2.Grids;
using MVZ2.Models;

namespace MVZ2.Entities
{
    public class GridModelInterface : ModelInterface
    {
        public GridModelInterface(GridController ctrl)
        {
            this.controller = ctrl;
        }
        protected override Model? GetModel()
        {
            return controller.GetModel();
        }
        protected GridController controller;
    }
